import React, {Component} from 'react';
import './App.css';
import Developer from './components/developer';

const customer = {
  'name':'하늘',
  'birthday':'920927',
  'gender':'남자',
  'job':'대학원생'
}

function App() {
  return (
    <Developer
      name={customer.name}
      birthday={customer.birthday}
      gender={customer.gender}
      job={customer.job}
    />
  );
}

export default App;
